---
import type { TextualInput as Props } from "../../../../types";
import mapDataset from "../../../utilities/mapDataset";

const { cssClasses = [], dataset, form, id, name, ...attrs } = Astro.props;

const css = ["sb-input", ...cssClasses].join(" ");
const data = mapDataset(dataset);
---

<span>
	<input
		{...attrs}
		aria-labelledby={`${id}_label`}
		class={css}
		{...data}
		id={id}
		form={form}
		name={name}
	/>
</span>
